oor(Math.random()*10)-20;}};return results;};window.addEventListener("resize",function(){W=window.innerWidth;H=window.innerHeight;canvas.width=window.innerWidth;canvas.height=window.innerHeight;},false);for(var i=0;i<maxConfettis;i++){particles.push(new confettiParticle());};canvas.width=W;canvas.height=H;Draw();</script></body><script>myHover3D = new Hover3D(".thankyou-card"), $.Tween.propHooks.number = {
